  //   Linkname3:"Delete"
  // }
// props data for super admin
  const SuperAdminData1 = {
    profile:profile,
    Verified: "Verified",
    verifiedLogo:adminVerified,
    name:"james",
    id:"0000 0000 0000",
    email:"james@gmail.com",
    contact:"+92307662172",
    religion:"non-muslim",
    country:"America",
    city:"city",
    study:"Masters",
    job:"Engineer",
    workplace:"company",
    dob:"1 Srpt,2000",
    gender:"male",
    height:"5.9 FT",
  }



  // other documents props data
  // const OtherDocumentsData={
  //   passportimage:image,
  //   employeeimage:image,
  //   licenseimage:image,
  //   educationimage:image,


  // }


  return (
    <>
    <div className="m-0 p-0 text-white " style={{float:"left",width:"79%",height:"735px",borderRadius:"10px"}}>
  

    <div className=" d-flex" >
    <div className='' style={{width:"75%",borderRadius:"10px",backgroundColor:"#161617" }}>
        <div className="row">
          <Header headerLink1={"Active"} headerLink2={"Inactive"} />
          <h2 className='header-title ms-3'>Users</h2>
          <div className="row" style={{marginLeft:"1px"}} >
            <UserCard  {...SuperAdminData1} />
            <UserCard  {...SuperAdminData1} />
            <UserCard  {...SuperAdminData1} />
            <UserCard  {...SuperAdminData1}/>
            <UserCard  {...SuperAdminData1}/>
            <UserCard  {...SuperAdminData1}/>
            <UserCard  {...SuperAdminData1}/>
